Settings.fileupload=main.baseDataView.extend({
    collectionName:'SimplePageCollection',
    collectionUrl:'/Publicfiles/',
    title:'',
    filterFields:['filename'],
    paginator:true,
    minScreenSize:0,
    renderOptions:{nofield:true},
    templateName:'default',
   // filterFields:['puppet','boss'],
    constructColumns:function(){
        var self=this;
        var editable=false;
        if(parseInt(this.rank||"1")==3){
            editable=true;
        }
        return Promise.all([util.ajaxGET('/User/'),util.ajaxGET('/Role/'),util.ajaxGET('/DocType/')]).spread(function(user,role,type){
            var userselect=BackgridCells.SelectCell({name:"",values:_.map(user,function(e){return [e.nickname,e.id]})});
            var uri=BackgridCells.Cell.extend({
                cellText:'download',
                action:function(e){
                    window.open("/PublicFiles/getFile/"+this.model.get('id'));
                },
                render: function () {
                    this.$el.html('<a src="/PublicFiles/getFile/'+this.model.get('id')+'">download</a>');
                    this.delegateEvents();
                    return this;
                }
            });
            var typeselect=BackgridCells.SelectCell({name:'',values:_.map(type,function(e){return [e.docType,e.id]})});
            var roleselect=BackgridCells.SelectCell({name:'',values:_.map(role,function(e){return [e.role,e.id]})});
            self.columns=[
                {name:'filename',label:'',editable:false,cell:'string'},
                {name:'createdAt',label:'',editable:false,cell:'datetime'},
                {name:'uploadedBy',label:'',editable:false,cell:userselect},
                {name:'fileCategory',label:'',cell:typeselect},
                {name:'role',label:'',cell:roleselect},
                {name:'',label:'',editable:false,cell:uri},
                {name:'',label:'Delete',cell:BackgridCells.DeleteCell}
            ];
            // self.selectFields=[
            // {name:'puppet',options:_.map(user,function(e){return [e.nickname,e.id]})},
            // {name:'boss',options:_.map(user,function(e){return [e.nickname,e.id]})},
            // ];
            return Promise.resolve({});
        });
    },
    destroy: function () {
        this.$el.removeClass('active');
        this.undelegateEvents();
    },
    afterRender:function(){
        this.$el.attr('id', this.id);
        this.$el.addClass('active');
        //$('.content').prepend('<div id="uploader" style="margin:auto;border-style:solid;width:100px;text-align:center;height:50px" class="dropzone">Drop Files here</div>');
        $('.content').prepend('<form action="/" class="dropzone"></form>');
        
        var myDropzone = new Dropzone(".dropzone", { url: "/PublicFiles/"});
        var self=this;
        myDropzone.on('success',function(file,data){
           //console.log("success",arguments);
            self.collection.add(data);
            util.handleRequestSuccess({responseText:"Upload Successful"});
            //myDropzone.removeFile(file);
        });
    },

});
